        <div className="row py-5">
       
        <div className="col-md-6 order-2 order-md-1">
            <h1 className="text-center">We are the best developer of our time <spna>{time}</spna></h1>
        </div>
        <div className="col-md-6 order-1 order-md-2">
            

        </div>

        </div>

        
    );
}

export default Home;
